import React from 'react';
import styled from 'styled-components';
import Ethereum from './Ethereum';


const Container = styled.div`
                display: flex;
                flex-direction: row;
                align-items: center;
                background-color: #000;
                padding: 15px;
                border-radius: 4px;
  }
`;



const HeaderContainer = (props) => {
    return (  
    <Container>
    <Ethereum/>
    </Container>
        );
  }

  export default HeaderContainer;
